import React, { Component } from "react";
import Todolist from "./Todolist";
import "./App.css";

class App extends Component {
  state = {
    todos: [
      { content: "buy", id: 1 },
      { content: "go", id: 2 }
    ]
  };
  render() {
    return (
      <div class="Allpage">
        <div className="container">
          <div className="header">
            <h1>Todos</h1>
          </div>
          <Todolist todos={this.state.todos} />
        </div>
      </div>
    );
  }
}

export default App;
